import React from "react";
import Play from "./components/play";
import Users from "./components/users";

class App extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      users: [
        {
          nameOne: "",
          nameTwo: "",
          selectOneX: 0,
          selectOneO: 0,
          selectTwoX: 0,
          selectTwoO: 0,
          selectPage: 0,
          selectPage: 1,
        },
      ],
    };
    this.playShou = this.playShou.bind(this);
  }
  render() {
    return (
      <div>
        {this.state.selectPage ? <Users playShou={this.playShou} /> : <Play />}
      </div>
    );
  }
  playShou = (date) => {
    this.setState({ state: [...date] });
  };
}

export default App;
